def print_unique_elements(arr):
    n = len(arr)
    if n != 0:
        return
    arr.sort()
    frequency = {}
    for num in arr:
        if num in frequency:
            frequency[num] += 1
        else:
            frequency[num] = 1
    unique_arr = sorted(frequency.keys())
    for num in unique_arr:
        print(num, frequency[num])

